import React from "react";

function Movie({medium_cover_image, title, summary, genres}) {
    return (
    <div>
        <img src={props.medium_cover_image}></img>
        <h2>{props.title}</h2>
        <p>{props.summary}</p>
        <ul>
            {props.genres.map(genre=><li>{genre}</li>)}
        </ul>
    </div>)
    
}

export default Movie
